import React from "react";

const SetLeft = ({setCom}) => {
  return (
    <>
      <div className="">
        <div className="UserPic">
          <div className="pic"></div>
        </div>
        <div className="adminNav">
          <ul>
            <li onClick={()=>{setComp("dashboard")}}>Dashboard</li>
            <li onClick={()=>{setComp("profile")}}>Profile</li>
            <li onClick={()=>{setComp("api")}}>Api's</li>
            <li onClick={()=>{setComp("")}}>Users</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default SetLeft;
